  // const secondItem = Object.entries(firstIteration[0][1]);
  const favs = props.favs;
  //   console.log(favs);

  return (
    <>
      <ul className={styles.list}>
        {/* {favs.map((item) => {
          return (
            <>
              <FavouriteItem
                key={item.DOTCode}
                id={item.DOTCode}
                Name={item.Name}
                Country={item.Country}
                City={item.City}
                Address={item.Address}
                PostalCode={item.PostalCode}
                DOTCode={item.DOTCode}
                Status={item.Status}
              />
            </>
          );
        })} */}
      </ul>
    </>
  );
};

export default FavouriteList;
